css:
atom-text-editor::shadow .atom-jshint-error {
  color: #ff6347;
}
.atom-jshint-pane {
  font-size: 11px;
  line-height: 22px;
  color: #9da5b4;
  font-weight: normal;
  background-color: #21252b;
  overflow: auto;
  max-height: 80px;
  border-top: 1px solid #181a1f;
  padding: 0 12.5px;
  cursor: pointer;
}
.atom-jshint-pane span:hover {
  text-decoration: underline;
}
